import { createBrowserRouter } from "react-router-dom";
import { RootPage } from "../pages/Root/RootPage";
import { API } from "../pages/API";

export const router = createBrowserRouter([
    {
        path:"/",
        element: <RootPage/>
    },
    {
        path: "api/",
        element: <API/>
    }
])
